webpackJsonp([91760665394868],{1064:function(s,n){s.exports={data:{package:{id:"bs-mysql",score:.4769932285232234,name:"bs-mysql",version:"0.1.3",description:"Bucklescript bindings for mysql.js, written in Reason.",keywords:["databases","mysql","node","bucklescript"],license:"MIT",updated:"2018-01-14T11:07:24.017Z",stars:0,type:"published",quality:.41189763437895077,popularity:.016478576674255157,maintenance:.9933041039244255,readme:'<h1>MySQL.js Bindings for Reason/Bucklescript</h1>\n<p>This repository contains in-progress Reason/Bucklescript bindings for <a href="https://github.com/mysqljs/mysql">mysql</a>.</p>\n<h2>Example</h2>\n<pre><code class="language-ocaml">let conn = Mysql.connect(~host="127.0.0.1", ~port=3306, ~user="root");\n\nMysql.query(\n  conn,\n  "SHOW DATABASES",\n  (error, results, fields) =>\n    switch (Js.Nullable.to_opt(error)) {\n    | None =>\n      Js.log(results);\n      Js.log(fields)\n    | Some(error) => Js.log(error##message)\n    }\n);\n\nMysql.endConnection(conn);\n</code></pre>\n<h2>Installation</h2>\n<ol>\n<li>Install the bindings using <code>npm install --save bs-mysql</code></li>\n<li>Add the bindings to <code>bsconfig.json</code>:</li>\n</ol>\n<pre><code class="language-json">{\n  "bs-dependencies": [\n      "bs-mysql"\n  ]\n}\n</code></pre>\n<h2>Build</h2>\n<pre><code>npm run build\n</code></pre>\n<h2>Build + Watch</h2>\n<pre><code>npm run start\n</code></pre>\n<h2>Current State &#x26; Todo</h2>\n<p>The API is still very incomplete. Use at your own risk, contributions are welcome!</p>\n',homepageUrl:"https://github.com/davidgomes/bs-mysql",repositoryUrl:"https://github.com/davidgomes/bs-mysql",npmUrl:"https://www.npmjs.com/package/bs-mysql",issuesUrl:"https://github.com/davidgomes/bs-mysql/issues",slug:"packages/bs-mysql"}},pathContext:{id:"bs-mysql"}}}});
